import "./text.css";

function About() {
  const descriptionRef = React.useRef();
  const handleSubmit = () => {
    alert(descriptionRef.current.value);
    // event.preventDefault();
    // ... get data form
    // ... submit to API or something
  };
  return (
    <div className="Box">
      <label>
        Enter your description :
        <br />
        <br />
        <input type="string" ref={descriptionRef} />
      </label>
      <br />
      <br />
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
}

export default About;
